import React from 'react'
import { useHistory } from "react-router-dom";

import Illustration from '../../Assets/illutration.jpg'

const Login = () => {
    const history = useHistory()

    const Onlogin = () => {
        history.push('/home')
    }
    return (
        <div className='Login-container'>
            <svg className='Blob' viewBox="0 0 200 200" xmlns="http://www.w3.org/2000/svg">
                <path fill="#2EE799" d="M41.1,-58C47.3,-52,42.5,-32.1,41.1,-17.7C39.7,-3.4,41.8,5.4,39.5,13C37.2,20.5,30.6,26.7,23.3,33.2C16,39.7,8,46.4,-0.7,47.3C-9.3,48.2,-18.7,43.4,-30.7,38.5C-42.7,33.5,-57.3,28.4,-65.5,17.8C-73.7,7.2,-75.4,-8.9,-69.2,-20.7C-63,-32.5,-48.7,-40,-35.9,-43.9C-23,-47.8,-11.5,-48,3,-52.1C17.4,-56.2,34.8,-64,41.1,-58Z" transform="translate(100 100)" />
            </svg>
            <div className='left-box'>
                <img src={Illustration} alt='Illustration' draggable='false' />
            </div>
            <div className='right-box'>
                <h2>Login</h2>
                <input placeholder='Email' />
                <input placeholder='Password' />
                <button onClick={Onlogin}>Login</button>
            </div>
        </div>
    )
}

export default Login
